INSERT INTO `questions` VALUES (1,'Is developing software part of your job? || Yes || No','bg',1,'mc','2019-04-05 17:53:50','2019-04-05 17:53:50'),(2,'What is your job title?','bg',1,'string','2019-04-05 17:53:50','2019-04-05 17:53:50'),(3,'For how many years have you been developing software?','bg',1,'string','2019-04-05 17:53:50','2019-04-05 17:53:50'),(4,'What is your area of software development?','bg',1,'string','2019-04-05 17:53:50','2019-04-05 17:53:50'),(5,'How would you rate your json expertise? || Beginner || Intermediate || Expert || No experience at all using json','bg',1,'mc','2019-04-05 17:53:50','2019-04-05 17:53:50'),(6,'Have you used StackOverflow to search for information before? || Yes || No','bg',1,'mc','2019-04-05 17:53:50','2019-04-05 17:53:50'),(7,'Have you contributed to StackOverflow before ? (questions, answers, comments, discussion etc.) || Yes || No','bg',1,'mc','2019-04-05 17:53:50','2019-04-05 17:53:50'),(8,'Which of the following statements best describes this highlighted sentence? || The sentence is meaningful and provides important/useful information needed to correctly accomplish the task in question || The sentence is meaningful, but does not provide any important/useful information to correctly accomplish the task in question || The sentence does not make sense to me.','sg',1,'mc','2019-04-05 17:53:50','2019-04-05 17:53:50'),(9,'Given this highlighted sentence, indicate whether you agree with the following statement “When reading this thread, I would like to be able to quickly locate this sentence” || Strongly agree || Agree || Neither agree or disagree || Disagree || Strongly disagree','sg',1,'mc','2019-04-05 17:53:50','2019-04-05 17:53:50'),(10,'Given this highlighted sentence, indicate whether you agree with the following statement “Highlighting this sentence helps me navigate to relevant solutions and disregard irrelevant solutions” || Strongly agree || Agree || Neither agree or disagree || Disagree || Strongly disagree','sg',