INSERT INTO `sentences` VALUES (-3,-1,'-1','-1','-1','2019-04-05 19:14:29','2019-04-05 19:14:29'),(-2,30156407,'answer-30354106','In JAVA, you can use <a href=\"https://jersey.java.net/\" rel=\"nofollow noreferrer\">Jersey</a>, <a href=\"https://stackoverflow.com/questions/20400233/spring-mvc-requestmapping-from-json\">Spring</a>, or <a href=\"http://jackson.codehaus.org/\" rel=\"nofollow noreferrer\">Jackson</a>.','-1','2019-04-05 19:14:21','2019-04-05 19:14:21'),(-1,30156407,'answer-30354106','Hope this helps.','-1','2019-04-05 19:14:20','2019-04-05 19:14:20'),(173,49996456,'answer-51494250','But if you need to use older versions:','1','2019-04-05 19:14:58','2019-04-05 19:14:58'),(175,49996456,'answer-51494250','Then your <code>typings.d.ts</code> should be in the <code>src</code> directory as described in <code>include</code> property','3','2019-04-05 19:14:58','2019-04-05 19:14:58'),(177,50227069,'answer-50227170','Don\'t mix <code>var</code> and <code>let</code>/<code>const</code> - if you\'re using ES6, which you should be, always use <code>const</code>, except when you need to reassign, in which case use <code>let</code>.','4','2019-04-05 19:14:59','2019-04-05 19:14:59'),(178,50522602,'answer-50523464','Next we add custom getter and setter for public property which checks each it is invoked if <code>_isPlaying</code> is null.','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(179,50522602,'answer-50523464','And if so it returns your default value.','2','2019-04-05 19:14:59','2019-04-05 19:14:59'),(180,50522602,'answer-50523464','Otherwise you should consider using another json library like Jackson which as I know supports Kotlin well.','3','2019-04-05 19:14:59','2019-04-05 19:14:59'),(181,51674222,'answer-51674892','and perhaps a third, but a casual scan of the Construct project pages doesn\'t tell me if it is available: have Construct output JSON or at least a JSON-compatible dictionary, perhaps by using adapters.','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(183,51674222,'answer-51675877','In this case skipping just by type should suffice, but in case the <code>_io</code> key holds some other undesirable data this guarantees it won\'t be in the final result.','3','2019-04-05 19:14:59','2019-04-05 19:14:59'),(184,51674222,'answer-51675877','Of course, if your structure contains some other exotic data or data that is represented in JSON differently based on its type, this approach might mess it up as it turns all mappings into <code>dict</code> and all sequences into <code>list</code>.','2','2019-04-05 19:14:59','2019-04-05 19:14:59'),(189,50703187,'answer-50703313','Another thing to notice, is that <code>require</code> is synchronous, so if your JSON is specially large, the first time you instanciate <code>MyClass</code> the event loop will be blocked.','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(191,50703187,'answer-50703427','I\'d only put <code>require</code> inside the constructor if it was a dynamic dependency, like <code>const wordlist = require(</code>./config/lang/${lang}.json<code>)</code>.','2','2019-04-05 19:14:59','2019-04-05 19:14:59'),(192,50014635,'answer-50014693','Do add proper error handling like if file does not exists, then send back <code>404</code> using something like below:','2','2019-04-05 19:14:59','2019-04-05 19:14:59'),(193,50014635,'answer-50014701','Please use this method carefully and only if you know what you are doing.','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(194,50014635,'answer-50014701','If you do not wanted to create a designated directory (in this case \'public\' folder) and put all your top level folders there in order to access it.','3','2019-04-05 19:14:59','2019-04-05 19:14:59'),(195,50957609,'answer-50957707','Loop through the object and check to see if car1 exists on the next level down.','2','2019-04-05 19:14:59','2019-04-05 19:14:59'),(196,50957609,'answer-50958104',' The good news is this will work if given an Array of objects as well instead of a nested Object, but only because we don\'t care about the keys that hold the objects and only that an object actually has a \'car1\' property','4','2019-04-05 19:14:59','2019-04-05 19:14:59'),(197,49742914,'answer-49742993','Check the result of <code>localeCompare</code> on the property <code>user</code>, if it is either <code>-1</code> or <code>1</code> then return that result.','2','2019-04-05 19:14:59','2019-04-05 19:14:59'),(198,49742914,'answer-49743008','This works because <code>||</code> will only consider the second component if the <code>localeCompare</code> is zero.','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(199,49742914,'answer-49743008','I also want to point out that <code>||</code> is not only making the checking of the statement concise, it also allows you to chain further checks in your sorting requirement.','3','2019-04-05 19:14:59','2019-04-05 19:14:59'),(200,49742914,'answer-49743033','This alternative compares the usernames first <strong>(faster than a precipitated localeCompare execution)</strong>, if they are equal then a common comparison between integers is executed.','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(201,50088757,'answer-50088868','You should cast your data to the <code>[[String: Any]]</code> type because you have array in response.','3','2019-04-05 19:14:59','2019-04-05 19:14:59'),(202,50088757,'answer-50088868','Or if you want to get just only one <code>[String: Any]</code> object from response you can write:','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(203,50088757,'answer-50088868','Or if your object can be an array or not an array (but it sounds a little bit strange) you could try to cast to several possible types.','2','2019-04-05 19:14:59','2019-04-05 19:14:59'),(204,51580523,'answer-51580586','You can use session storage if you want the data to be retrieved once <strong>PER SESSION</strong> or local storage if you want to have better control of the data\'s \"expiration\".','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(205,51580523,'answer-51580653','You could put the data in <a href=\"https://developer.mozilla.org/en-US/docs/Web/API/Window/localStorage\" rel=\"nofollow noreferrer\"><code>localStorage</code></a> and always check if there is some data there before doing the request.','2','2019-04-05 19:14:59','2019-04-05 19:14:59'),(206,51580523,'answer-51583718','If you\'re correctly sending change/delete requests - they will be memorized and refresh will read updated data (if not cached).','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(207,51580523,'answer-51583718','If it\'s a SPA (Single Page App) there is no need for refresh - it shouldn\'t happen.','3','2019-04-05 19:14:59','2019-04-05 19:14:59'),(208,51682923,'answer-51682974','People might be able to give better answers if you include the following:','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(209,51682923,'answer-51683218','If your json contains from 0.....N number of persons then <code>BatchUpdate</code> is good solution for you this may reduce your database round trip if you have performance requirement','5','2019-04-05 19:14:59','2019-04-05 19:14:59'),(210,51682923,'answer-51683218','<a href=\"https://jishnutkl.wordpress.com/tag/mysql-bulk-insert-from-c-net/\" rel=\"nofollow noreferrer\">Here</a> is good article if you have to use <code>StoedProcedure</code> as insert command.','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(211,50460523,'answer-50460596','<code>for item in data:\n    if item[\'hostname\'] == \'c.example.com\':\n       item.update(update)\n</code>\nThis works only if the keys in your <code>update</code> variable overlap with the keys in the item.','2','2019-04-05 19:14:59','2019-04-05 19:14:59'),(212,50460523,'answer-50460873','If you have something assigned to x, e.g. <code>x = object1</code>, then if you write <code>x = object2</code>, that does not influence <code>object1</code>* (or any other data, for that matter) in any way.','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(213,50460523,'answer-50460873','What you actually want is to modify <code>data</code>, so you should do so, e.g.','3','2019-04-05 19:14:59','2019-04-05 19:14:59'),(214,50460523,'answer-50460873','(*) Although the original data is not modified by this, it may be \"deleted\" i.e. it\'s memory may be freed if it is no longer referenced by any variable, because it is no longer needed.','1','2019-04-05 19:14:59','2019-04-05 19:14:59'),(215,50619917,'answer-50620118','and you will also have to add the <code>async</code> keyword to your top function that wraps your code, but if this is a website you\'ll need to use babel for this to work in all browsers.','2','2019-04-05 19:14:59','2019-04-05 19:14:59'),(217,50605220,'answer-50605397','You can use this regex if you have to use <code>type=\"text\"</code>','1','2019-04-05 19:15:00','2019-04-05 19:15:00'),(218,50605220,'answer-50606096','If it passes this validation then you check if it exceedes the max value of your input.','2','2019-04-05 19:15:00','2019-04-05 19:15:00'),(219,50605220,'answer-50606096','For the min value, the user cannot enter something below <code>0</code> because to do that he should be able to write <code>-</code>, which doesn\'t pass the first condition ( numbers only )','3','2019-04-05 19:15:00','2019-04-05 19:15:00'),(220,49638703,'answer-49666744','For example if the given date range is valid.','2','2019-04-05 19:15:00','2019-04-05 19:15:00'),(221,49638703,'answer-49666744','Stating this, if a returning error code cannot be used to figure out the exact problem of the request, the design of the API interface <strong>might</strong> be not optimal.','1','2019-04-05 19:15:00','2019-04-05 19:15:00'),(222,49638703,'answer-49667023','But I think in your case, you should rather investigate why the client is unable to display the <code>errorMsg</code> - this should be the best and most flexible way to go to add additional validations in the future.','3','2019-04-05 19:15:00','2019-04-05 19:15:00'),(223,51628014,'answer-51628170','Then, if the content may have been updated, you should override the previously downloaded files with the new ones, at app launch.','1','2019-04-05 19:15:00','2019-04-05 19:15:00'),(224,51628014,'answer-51628170','Please tell me if you need help for Swift translation :)','2','2019-04-05 19:15:00','2019-04-05 19:15:00'),(225,51628014,'answer-51628324','regarding sending app to background , the content won\'t reset if the app is left working by IOS , but if closed you will get a new launch when you open it again with array content is initiated from the begining','1','2019-04-05 19:15:00','2019-04-05 19:15:00'),(227,50254393,'answer-50261031','Pay attention if you need to serialize the data.','1','2019-04-05 19:15:00','2019-04-05 19:15:00'),(228,50254393,'answer-50261031','I hope the explanation makes sense and check the documentation if you need more info.','2','2019-04-05 19:15:00','2019-04-05 19:15:00'),(229,50254393,'answer-50290238','The function needs to be of type JsonResult, and the returned value of Json using  JsonRequestBehavior.AllowGet.','3','2019-04-05 19:15:00','2019-04-05 19:15:00'),(230,50254393,'answer-50290238','If you use console.log the result returned from the mvc controller and view it in the browser inspect you\'ll see the object with lots of other info and the values you want are in the .data section of the object.','3','2019-04-05 19:15:00','2019-04-05 19:15:00'),(231,49868076,'answer-49875401','Probably, the compiler is giving you a warning, but allows you to have such a constructor, even if it will result in undefined behavior or <strong>slicing</strong> an instance of <code>MyObject</code> every time it is passed by value.','4','2019-04-05 19:15:00','2019-04-05 19:15:00'),(232,49868076,'answer-49875401','Furthermore, if you want to exploit polymorphic behavior you must use pointers, even if there is no explicit need to cast to derived classes in your code, as far as I can see.','2','2019-04-05 19:15:00','2019-04-05 19:15:00'),(233,49868076,'answer-49904853','If your code uses the class as a <code>QObject</code> for any reason other than to get meta information, you are almost certainly using it incorrectly if you are trying to store it by value (as explained by G. Giordano in their answer).','1','2019-04-05 19:15:00','2019-04-05 19:15:00'),(234,50485037,'answer-50485134','Overwrites the existing file if the file exists.','8','2019-04-05 19:15:00','2019-04-05 19:15:00'),(235,50485037,'answer-50485160','You\'ll also need to account for the file not yet existing, and if you don\'t want to wait for locks forever, you need to handle timeouts (meaning you need to use <code>LOCK_NB</code> <em>in a loop</em> and test for the return value to see if the lock was acquired, until a certain amount of time has passed).','1','2019-04-05 19:15:00','2019-04-05 19:15:00'),(236,50485037,'answer-50485160','In the following context manager, I used the <code>os.open()</code> low-level system call to ensure the file is created when trying to lock it for exclusive access <em>without truncating it if it already exists</em>:','1','2019-04-05 19:15:00','2019-04-05 19:15:00'),(237,50485037,'answer-50485160','If you want to allow for a timeout, add a <code>try/except</code> block around the <code>with</code> block and catch the <code>Timeout</code> exception; you\'ll need to decide what should happen then:','3','2019-04-05 19:15:00','2019-04-05 19:15:00'),(238,49638703,'answer-49667023','This validation error message should be human-readable and it should be okay for the client to display it to the user.','6','2019-04-05 19:15:00','2019-04-05 19:15:00'),(239,49742914,'answer-49742993','If it returned a falsy value (<strong>i.e.</strong> <code>0</code>) then the value of the other operand of <code>||</code> will be returned (which is sorting by <code>timestamp</code>)','6','2019-04-05 19:15:00','2019-04-05 19:15:00'),(240,49868076,'answer-49904853','Misuse considerations aside, in order to JSON-ify a <code>QVariant</code> that stores a <code>QObject</code> subclass by value, you can use the <code>QMetaType::create</code> method and pass it the user type id and <code>yourQVariant.constData()</code>.','6','2019-04-05 19:15:00','2019-04-05 19:15:00'),(241,49996456,'answer-51494250','But if you have an <code>include</code> property in your <code>tsconfig.json</code>:','8','2019-04-05 19:15:00','2019-04-05 19:15:00'),(242,50014635,'answer-50014701','You can then access your <code>user.json</code> in the folder <code>/api/user.json</code> at <code>localhost:8081/api/user.json</code>','6','2019-04-05 19:15:00','2019-04-05 19:15:00'),(243,50088757,'answer-50088868','You are trying to cast to <code>[String: Any]</code>, but you have an array of <code>[String: Any]</code> because your response enclosed in <code>[]</code> brackets.','6','2019-04-05 19:15:00','2019-04-05 19:15:00'),(245,50227069,'answer-50227170','Use <code>.reduce</code> to convert the array into an object, as you\'re doing, but then you need to <code>.find</code> twice to see if the matching <code>name</code> and then if the matching <code>value</code> object exists.','8','2019-04-05 19:15:00','2019-04-05 19:15:00'),(246,50254393,'answer-50261031','Normally one of the layers requires the use of services and you can have your controllers and your services (the place where you get the raw data from the server and you make the request.','6','2019-04-05 19:15:00','2019-04-05 19:15:00'),(247,50460523,'answer-50460873','After <code>item = update</code>, variable <code>item</code> no longer references an item from <code>data</code>, it references a different variable: <code>update</code>.','6','2019-04-05 19:15:00','2019-04-05 19:15:00'),(248,50485037,'answer-50485134','Overwrites the existing file if the file exists.','6','2019-04-05 19:15:00','2019-04-05 19:15:00'),(249,50522602,'answer-50523464','Otherwise, it returns the value stored in <code>_isPlaying</code>','6','2019-04-05 19:15:00','2019-04-05 19:15:00'),(250,50605220,'answer-50605288','If your input field values are numbers, then you can use input type \'number\' .','6','2019-04-05 19:15:00','2019-04-05 19:15:00'),(251,50619917,'answer-50620194','<code>fetch</code> returns a <code>Promise</code>, so if you want to use slice method, you should use it inside the last <code>.then()</code>, but it would be better if you fetch your data in <code>componentDidMount</code>, save your data in React state, and after that use in <code>render</code> method;','10','2019-04-05 19:15:00','2019-04-05 19:15:00'),(252,50703187,'answer-50703313','So, yes, in my opinion, <code>require</code> calls should be at the top, unless you know what you\'re doing, or you\'re loading a dynamic dependency.','9','2019-04-05 19:15:00','2019-04-05 19:15:00'),(253,50957609,'answer-50958104','You\'re not looping over an Array, you are looping over the properties of an Object with a <a href=\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Statements/for...in\" rel=\"nofollow noreferrer\"><code>for...in</code></a> loop.','6','2019-04-05 19:15:01','2019-04-05 19:15:01'),(254,51580523,'answer-51580716','Solution :- <em>You must use database</em> , when you save data you do it in db , when you delete data , you delete it from db &amp; when you fetch data then you fetch from db.','6','2019-04-05 19:15:01','2019-04-05 19:15:01'),(255,51628014,'answer-51628324','regarding the download every launch , i recommend having expire or new data flag , you should store them in a file/coreData or any other alternative and , it\'s best to implement <code>Codable</code> , to read them as <code>Data</code> to objects and vice versa when saving','9','2019-04-05 19:15:01','2019-04-05 19:15:01'),(257,51682923,'answer-51683003','and here how you can insert to db :\nfor ADO.Net : <a href=\"https://msdn.microsoft.com/en-us/library/ms233812.aspx\" rel=\"nofollow noreferrer\">https://msdn.microsoft.com/en-us/library/ms233812.aspx</a>','6','2019-04-05 19:15:02','2019-04-05 19:15:02'),(258,51674222,'answer-51675877','<a href=\"https://docs.python.org/3/library/json.html#json.dump\" rel=\"nofollow noreferrer\"><code>skipkeys</code></a> doesn\'t do what you might think it does - it instructs the <a href=\"https://docs.python.org/3/library/json.html#json.JSONEncoder\" rel=\"nofollow noreferrer\"><code>json.JSONEncoder</code></a> to skip keys that are not of a <em>basic</em> type, not the values of the keys - i.e. if your had a <code>dict</code> <code>{object(): \"foobar\"}</code> it would skip the <code>object()</code> key, whereas without <code>skipkeys</code> set to <code>True</code> it would raise a <code>TypeError</code>.','7','2019-04-11 17:17:37','2019-04-11 17:17:37'),(262,51783807,'answer-51784010','You shouldn\'t use <code>contains/1</code> as it will not work the way you might expect it','4','2019-04-15 14:35:00','2019-04-15 14:35:00'),(263,51783807,'answer-51784010','It will recursively check if all parts are contained.','1','2019-04-15 14:35:00','2019-04-15 14:35:00'),(264,51783807,'answer-51784010','So not only will it check if the string is contained in the array, but if the string is also a substring','8','2019-04-15 14:35:00','2019-04-15 14:35:00');
